export default function List({clicked, lastLocation, address}) {
    return (
        <div>
            {clicked == true ?
       <p>You are located at: {address}</p> :null}
      {lastLocation.map((item) =>{
        
      return(<View>
      <Text> Your last location: {item}</Text>
      
      </View>
      )
    })}
        </div>
    )
}
